import React from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={styles.header}>Welcome to My Game</Text>
      <LevelButton level={1} />
      <LevelButton level={2} />
      {/* Repeat the above line to create buttons for levels 3 to 50 */}
    </View>
  );
}

function LevelButton({ level }) {
  const goToLevel = () => {
    // Navigate to the level screen here
  };

  return (
    <View style={styles.buttonContainer}>
      <Button title={`Level ${level}`} onPress={goToLevel} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  header: {
    fontSize: 24,
    marginBottom: 20,
  },
  buttonContainer: {
    marginVertical: 10,
  },
});
